"241454":{"id":"241454","name":"O Amor Mora ao Lado","slug":"o-amor-mora-ao-lado","original_title":"엄마친구아들","overview":"Na tentativa de recomeçar a vida, uma mulher retorna à Coreia e se envolve com alguém do passado. O problema é que existe uma história complicada entre os dois.","first_air_date":"2024-08-17","episode_run_time":80,"vote_average":8.1,"number_of_seasons":1,"number_of_episodes":16,"created_by":[],"production_companies":["Show Runners","Studio Dragon","CJ ENM","The MODORI"],"genres":["Drama","Comédia"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/blNanzce8lKnrfjDqWLdPNPy7mo.jpg","poster_path":"https://image.tmdb.org/t/p/original/lHSnzui4skTidHkAwQ2Qaccdokr.jpg","cast":["Jung Hae-in","정소민","김지은","Yoon Ji On","박지영"],"trailer":"igovXqQsA7U","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/gmMOdhUJwfbS29J75FIEDCP5npi.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gmMOdhUJwfbS29J75FIEDCP5npi.jpg","air_date":"2024-08-17","episode_count":16,"overview":"N/A","vote_average":8.6,"episodes":{"1":{"name":"Virada","overview":"Prestes a se casar, Bae Seok-ryu volta à Coreia e encontra o antigo amigo Choi Seung-hyo. Mas como esconde um segredo, ela fica estranha com ele.","air_date":"2024-08-17","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/lygWzI87b3tweRfUJlOgMcow6De.jpg","vote_average":9.1},"2":{"name":"Ódio","overview":"Seok-ryu esconde suas vulnerabilidades até mesmo das pessoas queridas. Até que um confronto com a mãe força Seung-hyo a ajudá-la.","air_date":"2024-08-18","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/ckcwSEmcmuPu295HVoAOnI9ZsxF.jpg","vote_average":6.7},"3":{"name":"Linha de parada","overview":"Seok-ryu tenta se adaptar à nova rotina de desempregada. Seung-hyo entra em conflito com o sócio depois de uma reunião tensa.","air_date":"2024-08-24","runtime":77,"still_path":"https://image.tmdb.org/t/p/original/2G922AmCcogbtfKXeb93AtvEwmt.jpg","vote_average":0},"4":{"name":"Pretérito perfeito","overview":"A antiga empresa de Seok-ryu aparece com uma oportunidade interessante, então ela e Seung-hyo começam a trabalhar juntos. Um encontro perturbador deixa Seok-ryu abalada.","air_date":"2024-08-25","runtime":78,"still_path":"https://image.tmdb.org/t/p/original/bp7HRFHNvEuX1g3dwKmPEFo7TqG.jpg","vote_average":10},"5":{"name":"Voltar","overview":"Antigos sentimentos voltam à tona, e Seung-hyo fica estranho com Seok-ryu. Para complicar tudo ainda mais, ele enfrenta uma situação delicada no trabalho.","air_date":"2024-08-31","runtime":79,"still_path":"https://image.tmdb.org/t/p/original/kkCQKLYKnlMHDPYpiV0h0CQhEi7.jpg","vote_average":7},"6":{"name":"Seu primeiro","overview":"Seok-ryu explora uma nova carreira, se entregando com tudo a uma paixão da infância. Mas sua família passa por uma crise quando o segredo de seu pai vem à tona.","air_date":"2024-09-01","runtime":82,"still_path":"https://image.tmdb.org/t/p/original/68Qn9zpmlIYsJWqu8BKvonW5bl9.jpg","vote_average":10},"7":{"name":"O amor é questão de momento","overview":"Uma pessoa do passado de Seok-ryu reaparece e surpreende a todos, inclusive Seung-hyo, que precisa encarar sentimentos complicados.","air_date":"2024-09-07","runtime":78,"still_path":"https://image.tmdb.org/t/p/original/xl1lGphdYeeTg58HVTmkzvXY889.jpg","vote_average":0},"8":{"name":"O segredo dele","overview":"A verdade finalmente vem à tona, e Seung-hyo espera uma resposta de Seok-ryu. Os pais de Seok-ryu descobrem a nova atividade dela e ficam furiosos.","air_date":"2024-09-08","runtime":80,"still_path":"https://image.tmdb.org/t/p/original/iMnpNhVBs0aWgYhDK3D4ywmbBia.jpg","vote_average":0},"9":{"name":"Escuridão na vida","overview":"Enquanto Seok-ryu lida com questões de saúde, Seung-hyo e Song Hyeon-jun competem por seu afeto. Porém, Seung-hyo logo descobre o verdadeiro motivo do seu retorno.","air_date":"2024-09-14","runtime":87,"still_path":"https://image.tmdb.org/t/p/original/6BO86hJIqHfW9BpdCGl1eiJaHtV.jpg","vote_average":0},"10":{"name":"Urso na caverna","overview":"O segredo de Seok-ryu vem à tona, deixando todos tristes e chocados. Quando ela desaparece, Seung-hyo sai desesperadamente para procurá-la.","air_date":"2024-09-15","runtime":91,"still_path":"https://image.tmdb.org/t/p/original/vsA4v6g4rUpQmKoJrBB2Le27PhL.jpg","vote_average":0},"11":{"name":"Tarde","overview":"O prazo para Seok-ryu tomar uma decisão está acabando, e Seung-hyo aguarda a resposta. Ele recebe uma notícia chocante dos pais.","air_date":"2024-09-21","runtime":90,"still_path":"https://image.tmdb.org/t/p/original/fooECTcapeyzM4TSH6rEU8hoOHq.jpg","vote_average":0},"12":{"name":"Amor juvenil","overview":"Seung-hyo e Seok-ryu tentam lidar com a nova dinâmica pessoal. O ciúme logo pinta, e eles precisam se resolver depois de uma briga.","air_date":"2024-09-22","runtime":84,"still_path":"https://image.tmdb.org/t/p/original/z8JQabyrbRs2kBIFK7qkFyBqR84.jpg","vote_average":0},"13":{"name":"Amor","overview":"Com o relacionamento evoluindo, Seung-hyo e Seok-ryu sofrem para mantê-lo em segredo. Jung Mo-eum descobre o motivo da frieza de Kang Dan-ho.","air_date":"2024-09-28","runtime":83,"still_path":"https://image.tmdb.org/t/p/original/IB1xYwAQmXbtsBPE820HJVlD4.jpg","vote_average":0},"14":{"name":"Doce amor","overview":"Seung-hyo decide estimular a ambição culinária de Seok-ryu. Convencido de que é o momento certo, ele faz uma pergunta importante.","air_date":"2024-09-29","runtime":80,"still_path":"https://image.tmdb.org/t/p/original/z9pgS4C3kfdr9u5IQU0kVsUT9Z1.jpg","vote_average":0},"15":{"name":"Parabéns, minha vida","overview":"As famílias de Seung-hyo e Seok-ryu descobrem o segredo dos dois e ficam furiosas. O clima pesa entre as mães.","air_date":"2024-10-05","runtime":77,"still_path":"https://image.tmdb.org/t/p/original/rnu2hHILin7pUakjYEnLbntwpKk.jpg","vote_average":0},"16":{"name":"O fim","overview":"Felizes da vida com o relacionamento, Seung-hyo e Seok-ryu se preparam para uma vida juntos. Um se inspira no outro enquanto correm atrás de seus objetivos pessoais.","air_date":"2024-10-06","runtime":73,"still_path":"https://image.tmdb.org/t/p/original/88NTlxtsqVsccFAoM3dfVm0hmQN.jpg","vote_average":0}}}}},
