"153411":{"id":"153411","name":"Os Enviados","slug":"os-enviados","original_title":"Los enviados","overview":"Dois padres precisam descobrir o paradeiro de um suposto curandeiro que desaparece misteriosamente. Logo eles descobrem uma comunidade psiquiátrica nos arredores da cidade que está escondendo segredos por trás do curandeiro desaparecido.","first_air_date":"2021-12-12","episode_run_time":0,"vote_average":7.9,"number_of_seasons":2,"number_of_episodes":16,"created_by":["Juan José Campanella"],"production_companies":["VIS","Portocabo","Paramount Television International Studios","100 Bares"],"genres":["Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/d2T2uk2joXhdJ5RuRG56rgsLoPp.jpg","poster_path":"https://image.tmdb.org/t/p/original/rCuFMVR6Tovsl8VlTzrJn4Njqk6.jpg","cast":["Miguel Ángel Silvestre","Luis Gerardo Méndez","Irene Azuela","Fernando Becerril"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/rCuFMVR6Tovsl8VlTzrJn4Njqk6.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/rCuFMVR6Tovsl8VlTzrJn4Njqk6.jpg","air_date":"2021-12-12","episode_count":8,"overview":"N/A","vote_average":7.9,"episodes":{"1":{"name":"Caminhem com os olhos bem abertos","overview":"Dois funcionários do Vaticano investigam uma cura milagrosa atribuída a um padre local. Após sua chegada, o misterioso desaparecimento do padre interrompe a investigação.","air_date":"2021-12-12","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/tm9OQjnOvkelMaxlvTZHuhHKHIa.jpg","vote_average":9},"2":{"name":"O diabo mostrou o rabo","overview":"Uma coincidência desperta dúvidas sobre Quintana. Uma testemunha revela novas informações sobre a cura de Valentina. A descoberta de um corpo tem semelhanças com a estranha infância de Salinas.","air_date":"2021-12-12","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/kQDCKG3JAUI4RrCakMwpuGb8BkO.jpg","vote_average":8},"3":{"name":"Juventude de Cristo","overview":"As autoridades locais estão investigando os recentes assassinatos. Os enviados são pressionados pelo Vaticano quando começam a investigar a fundo, colocando em risco sua estadia no México.","air_date":"2021-12-12","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/eT3VATLdoOuhyRAclIAnTMEGKOI.jpg","vote_average":7},"4":{"name":"Não grite","overview":"O Vaticano tenta mandar de volta os Enviados, enquanto eles sofrem as consequências por investigar Benavent, o qual revela sua verdadeira vocação. Molina Reyes descobre um segredo obscuro.","air_date":"2021-12-19","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/5FCV8TnDRMThJglpGedx70EH1rA.jpg","vote_average":8},"5":{"name":"Descida ao inferno","overview":"O Vaticano força os enviados a tomarem caminhos diferentes. Salinas testemunha um particular ritual. Antequera luta para continuar a investigação quando recebe uma surpreendente mensagem.","air_date":"2021-12-26","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/7K10eopsOvlsNxcgVLNmouuiJSw.jpg","vote_average":7},"6":{"name":"A viagem de Salinas","overview":"Antequera descobre o doloroso passado que Quintana compartilha com Adriana e Esteban. Salinas testa Benavent. Antequera planeja um arriscado plano com Emília, e Salinas descobre um novo talento.","air_date":"2022-01-02","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/yQewP0NuTPW4yaeG5XF1lIHneEh.jpg","vote_average":7},"7":{"name":"Meu nome é Legião","overview":"Os enviados impedem um nosso assassinato. Antequera e Salinas encontram respostas dentro do hospício enquanto o principal suspeito dos assassinatos foge.","air_date":"2022-01-09","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/2WZdfybH8BTZ0cjeHdxItVo9RhR.jpg","vote_average":9},"8":{"name":"Livra-nos do mal","overview":"A investigação chega a um final inesperado. Os Enviados relacionam Quintana às curas dentro do hospício.","air_date":"2022-01-16","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/g2cHjoZ255GEnjWzDMKnKbqRxQN.jpg","vote_average":8}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/hdigEw8rvAkythMO7IWTA3XAVPR.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/hdigEw8rvAkythMO7IWTA3XAVPR.jpg","air_date":"2023-12-07","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"O Oráculo do Porto da Lúa","overview":"Galicia. Terra de lendas. Os enviados chegam a Porto da Lúa para investigar um suposto milagre. Mas encontram um povo dividido, onde ninguém quer que eles cumpram a sua missão.","air_date":"2023-12-07","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/tlPA3eriNSA5CiiBxxlFrVLHfyI.jpg","vote_average":0},"2":{"name":"As Chaves do Reino","overview":"Após o achado do corpo de Joaquín Bustamante, Salinas tem uma visão. Nela, ele entende que este povoado esconde segredos tão perigosos que não apenas põem em risco a sua missão, mas as suas vidas.","air_date":"2023-12-07","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/4b7nGnlLKlKrf6dTd7HkGsLJp1f.jpg","vote_average":0},"3":{"name":"Os Cordeiros do Senhor","overview":"Nuno é agora o principal suspeito do assassinato de Bustamante. A sua vida corre perigo. Na noite da festa do povo, os Enviados são os únicos que podem salvá-lo. Se eles chegarem a tempo.","air_date":"2023-12-07","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/x7WTqjsICmkkvhxc1acIUwGQqBw.jpg","vote_average":0},"4":{"name":"Requiescat In Pace","overview":"Com a prefeita como principal suspeita do assassinato de Joaquín, somente os Enviados estão no caminho da Hermandad. Mas as dúvidas e o medo começam a afetá-los.","air_date":"2023-12-07","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/kY6rkdA3QDQATqx7VJIXDm5pNeg.jpg","vote_average":0},"5":{"name":"Livres do Pecado","overview":"Pilar é liberada das suspeitas e para a Hermandad, Nuno é o culpado. Antes fazerem \"justiça\", precisam impedir que Pilar controle a indústria pesqueira. Alba é sincera com a sua filha. Má ideia.","air_date":"2023-12-07","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/xgyhelxysrerVMVkuJHbuiyRBCe.jpg","vote_average":0},"6":{"name":"O Lago de Fogo","overview":"A verdadeira paternidade de Xiana é revelada. A raiva de Bernal ameaça o povoado. Enquanto isso, os Enviados entendem que a origem de tudo está em um passado que eles desconhecem. Nuno é a chave.","air_date":"2023-12-07","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/pQbC4DhxKViRpRjFDFCrAFub9he.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Descobrir o que aconteceu na noite em que as três freiras perderam a visão é a chave. Para isso, os calados deverão falar: as três irmãs, e a garota que viu a agressão contra Nuno e Cañola.","air_date":"2023-12-07","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/nlnELhrm6U2KOn9sUP25JsMVEhN.jpg","vote_average":0},"8":{"name":"A Luz em Meio às Trevas","overview":"Todas as cartas estão sobre a mesa. Os Enviados tentam sair vivos das garras da Hermandad. Pilar aposta o futuro do povoado. E Bernal está a ponto de perder tudo pelo que ele sempre lutou.","air_date":"2023-12-07","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/ibgcbo2dqprXClosQJWLHtmcoFO.jpg","vote_average":0}}}}},
